svg.script:
function setAll(users, fun) {
   for(i = 0; i < users.length; i++) {
      users[i].setAttribute("opacity", fun(users[i]));
   }
}

function showAll(e) {
   setAll(document.getElementsByClassName("user"), function(user) {
      return "1";
   });
}

function visibleFrom(id, user) {
   var myGroup = user.substring(0, user.lastIndexOf("_"));
   var otherGroup = id.substring(0, id.lastIndexOf("_"));
   if(otherGroup == myGroup) return true;
   if ((user.indexOf("admin") > -1 || user.endsWith("_leader")) && otherGroup.startsWith(myGroup)) {
      return !id.endsWith("_ext") && !id.endsWith("_exts") && !user.endsWith("_localadmin") || id.indexOf("team", myGroup.length) == -1 && id.indexOf("club", myGroup.length) == -1
   }
   return false;
}

function hideOthers(e) {
   setAll(document.getElementsByClassName("user"), function(user) {
      var id = user.id;
      if(visibleFrom(id, e.target.id)) {
         if(e.target.id.indexOf("admin") == -1 && e.target.id != id) {
            return "0.5";
         }
         else {
            return "1";
         }
      }
      else {
         return "0";
      }
   });
}
